Melem_pol::Melem_pol(): param(0), m(constants::me),
		m2(constants::me2), m4(constants::me4), m6(constants::me6),
		M(constants::mpr), M2(constants::mpr2), M4(constants::mpr4),
		alpha(constants::alpha) {

}

int Melem_pol::set_param(const Parameters* param) {

	this->param = param;
	m = param->m;
	m2 = pow(m,2.);
	m4 = pow(m,4.);
	m6 = pow(m,6.);
	M = param->M;
	M2 = pow(M,2.);

	return 0;
}

